import React, { Component } from 'react'
import styled from 'styled-components';

const RightDiv = styled.div` 
 background-color:blue;
 display:flex;
 
`

export default class RightBar extends Component {
  render() {
    return (
     <RightDiv > Let's do this thing </RightDiv>
    )
  }
}
